    quiz: [
      {
        anwers: [
          {test: 'Whot 1'},
          {test: 'Whot 2'},
          {test: 'Whot 3'},
          {test: 'Whot 4'}


        ]
      }
    ]
  }

  render() {
    return (
      <div className='Quiz'>
        <div className='QuizWrapper'>
          <h1>Quiz</h1>

          <ActiveQuiz />
        </div>
      </div>
    )
  }
}


export default Quiz
